import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faLight, faDumbbell } from '@fortawesome/free-solid-svg-icons'; // Correcci贸n de las importaciones

const CartWidget = () => {
    return (
        <div>
            <button>
                <FontAwesomeIcon icon={faLight} /> {/* Correcci贸n de la forma en que se establece el icono */}
                <FontAwesomeIcon icon={faDumbbell} /> {/* Correcci贸n del segundo icono */}
            </button>
        </div>
    );
}

export default CartWidget;
